  return (
    <div className="body">
      {props.offres && props.offres.map((e, i) => (
        <div key={i} className="offre">
          {/* Replace this placeholder content with your actual content */}
          <h3>{e.name}</h3>
          <p>{e.price}</p>
          <a href={e.imageUrl}>Learn More</a>
        </div>
      ))}
      
    </div>
  );
}

export default App;
